import { configureStore } from "@reduxjs/toolkit";
import { usersReducer } from "./slice/usersSlice";
import { alertReducer } from "./slice/alertSlice";

export const store = configureStore({
  reducer: {
    alert: alertReducer,
    users: usersReducer
  },
});

export * from './thunks/setAlert'
